(16, '2022-06-01 13:32:13', '2022-06-01 13:32:13', 13, 'Manuela Barroso Albujar', 'Zero professionalism, no commitment to the patient. It does nothing to save the pieces, the easiest thing is to extract. My mouth was healthy except for one molar, and he filed all my teeth to get me a badly glued denture. I have lost 4,000 euros for having put myself in her hands, and now I am going to a qualified dentist to fix what she destroyed.', '1'),
