(18, '2022-06-01 13:32:13', '2022-06-01 13:32:13', 13, 'Olga Pelaez', 'I gave it 5 stars 1 year ago and will do it again. Doctor Jovina fixed my father with covers and others, to this day he has not suffered or has been anything. My partner with a panic at the dentists, has only been treated by the doctor and her husband in a semi-surgery, the same, no one else touches his mouth. I idem, idem, I hear that cheap is expensive, I do not consider it that way. Cheap? For me it is not but I go to a good and trustworthy dentist', '5'),
(19, '2022-06-01 13:32:13', '2022-06-01 13:32:13', 13, 'Gema Muoz Snchez - Mateos', 'I DO NOT RECOMMEND. Dr. Jovina is only for fillings and care that they fall out in a couple of months. I had a very expensive treatment and I had to repeat it completely, including fillings, in a qualified clinic. It caused me wounds in the gums with some aesthetic crowns that changed me, and an infection because they were not even adjusted or glued correctly, leaving the necks in the air with a lot of pain and sensitivity, they also did not respect the color I requested and gave me an even darker one than mine, he was afraid to do the bruxism splint, and I had to call the police to give me the invoice, he asks for cash payments, and they dont have claim forms. They dont work with new technology, everything is very old. Dr. Jovina and Dr. Miguel are more concerned about money than about the patients health, plus the Doctor raises her voice and speaks to you in bad ways the moment you put a snag on her. He also polished the crowns once they were placed, removing all the enamel, no idea of dental aesthetics.\nI DO NOT RECOMMEND AT ALL. The worst clinic I have ever been to.', '1'),
