(113, '2022-06-01 14:40:21', '2022-06-01 14:40:21', 51, 'JUAN MARA Crego', '01/06/2022, 08.40horas voy a retirar un paquete con pago de aduana, recojo el paquete y abono el importe. 9.64, me dicen que me envan la factura al correo electrnico, no llega... 12.50 horas vuelvo a la oficina a pedir de nuevo la factura y me dicen que en un rato me llegara que lo est solicitando su compaera, me voy sin factura. 18,05 horas sigo sin factura y el telfono ni me lo cogen. Una vergenza de servicio.', '1'),
(114, '2022-06-01 14:40:21', '2022-06-01 14:40:21', 51, 'P SC', 'I had to make an urgent payment for a sick family member, and the man who attended me (grey hair, glasses and blue eyes) solved it for me instantly, even without having the right amount of money (I was thinking of doing it at the bank but there were all problems ), made the pertinent steps and clarified all my doubts. A 10 for that person, who treated me so kindly, finding someone with that predisposition to help in these times, is to feel grateful.', '5'),
(115, '2022-06-01 14:40:21', '2022-06-01 14:40:21', 51, 'Daniel Ropero', 'Possibly the worst customer service seen on the face of the earth. If you appreciate your shipments, your time, your money, your patience, I warn you that this is not your office.\nLaziness, total lack of empathy, they tell you that they dont have your package without even looking at it, contemptuous attitude to the user who dares to enter. If the Post Office is ever going to be a serious and respectable company, it should start laying off people like the ones it has working in this office.\nUser friend, you have been warned by me, avoid this office for your physical and mental health', '1'),
(116, '2022-06-01 14:40:21', '2022-06-01 14:40:21', 51, 'Mirela Da Silva', 'Servicio malo pero malo. El martes fui a buscar un carta que le enviaron a mi sobrina con una autorizacin y foto de su NIE . Llevada la hoja , original , dejada por el cartero . Mostre la autorizacin de mi sobrina mostre mis documentos de identidad y dudaron de mi , que tenan que revisar si era la firma de mi sobrina . Una falta de respeto a mi persona y a mi palabra .  No me entregaron la carta , la supervisora aleg que el NIE , documento que dan a los residentes europeos , no era vlido , ni tiene foto ni firma . Pero es el documento que nos obligan a sacar para poder residir en Espaa. Hoy  , cuando mi sobrina finalmente pudi ir personalmente , el sobre haba sido regresando al remitente , en USA, con todos los gastos en dinero y tiempo que eso implica', '1'),
