(156, '2022-06-01 14:40:21', '2022-06-01 14:40:21', 66, 'GGG', 'A laser hair removal scam. They sold me that with 4 sessions it would be OK. Also that the sessions were 1 hour. In the end I did 5 sessions and all of them lasted half an hour. The unfortunate result. Then they are not responsible for anything because you sign a document, which nobody reads and of which they do not give you a copy, where the result depends on many variables. They have their backs covered and do not comply with what they sell you.\n\nResponse to owners response\n\nFirst - The sessions were held within the period that you recommended. Second - I am a client, not a patient. I do not have any sickness.\nThird - I have not requested any FREE sessions.\nFourth - More professionalism and less pseudoscience.', '1'),
