(1, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 2 habitaciones y 75 m', '3', '75m', '2', '2', 'https://www.yaencontre.com/venta/piso/inmueble-1692-95-4382', '91 278 02 35', 'Bonita , luminosa y amplia vivienda. Tercera planta SIN ascensor,  amplia cocina, dos dormitorios y  dos cuartos de bao con plato de ducha. No tiene calefaccin. Ventanas de PVC, Carpintera interior de Roble.Agua caliente por termo electrico y suelos de tarima. Fontanera y electricidad renovadas. Gastos de comunidad 36 euros / mes.', '167.000 ', '-3.6405069', '40.5426321', '[\"segunda mano\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/1692\\/1692-43144460-1037117413.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/1692\\/1692-43144460-1037117417.jpg.webp\"]'),
(2, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 2 habitaciones con terraza y calefaccin', '3', '70m', '1', '2', 'https://www.yaencontre.com/venta/piso/inmueble-53190-258143-V', '91 218 41 35', 'Posibilidad de financiacion hasta el 100%  No dudes en consultarnos!\nDon Piso ofrece piso en el centro de Alcobendas, calle Transradio. La vivienda cuenta un vestbulo en la entrada que nos lleva al saln comedor muy amplio y luminoso con salida a una terraza, cocina amueblada y equipada con muebles altos y bajos con ventanas exteriores qu la hace muy luminosa, la calefaccin es individual de gas natural. Dos amplios dormitorios, antes eran tres pero se hizo reforma y se dejo en dos para mayor amplitud, uno de los dormitorios tiene un mueble a medida con camas plegables ideal para habitacin de nios, ambas exteriores las que cuentan con mucha luz natural. La vivienda tiene un amplio bao totalmente reformado con plato de ducha y mampara, radiador toallero, mueble lacado en blanco muy moderno, con un espejo con luz que da la sensacin de amplitud y limpieza en el mismo y suelo de terrazo esta a estrenar. El suelo de la vivienda es de parket y esta muy bien cuidado. Las puertas son de madera, la carpintera de aluminio, tiene ventiladores de techo en las habitaciones y en el saln. tiene muy buena comunicacin ya que esta cerca del paseo de la chopera, cerca tiene guardera, supermercados, estanco, veterinario. lneas de autobuses como el 2, 5, 10, 151. metro Mrquez de la Valdavia y centro medico Valdavia. ( El PVP indicado no incluye impuestos ni gastos de Escritura ). \nPARA PROPIETARIOS:\n Necesitas vender para comprar? te ayudamos coordinndolo todo y con hipoteca cambio de casa.\nTienes prisa en vender? te ofrecemos una venta rpida con todas las garantas.\nNecesitas una hipoteca? en donpiso la encuentras y en condiciones preferentes.\nHerencias? , Divorcios? , te ayudamos y coordinamos todo.\nInfrmate: 91 663 60 04 -.', '175.000 ', '-3.6410551', '40.5452414', '[\"1973ao de construccin\",\"segunda mano\",\"3nmero de pisos\",\"terraza\",\"calefaccin\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/53190\\/53190-44880936-1081305894.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/53190\\/53190-44880936-1081305895.jpg.webp\"]'),
