(4, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 3 habitaciones con calefaccin', '3', '60m', '1', '3', 'https://www.yaencontre.com/venta/piso/inmueble-49909-M171-V', '87 627 66 34', 'POSIBILIDAD DE FINANCIACIN HASTA EL 100 %\n NO DUDE EN CONTACTARNOS!\n \n LUMINOSO PISO AMUEBLADO, EN EL CENTRO DE ALCOBENDAS!\n ***PUEDE SER SUYO DESDE 467 euros/ MES***\n \n Piso en Alcobendas zona Centro.\n Dispone de 60 m2 y consta de; 3 habitaciones, un bao, saln y cocina equipada.\n Propiedad en buen estado Luminoso.\n Amueblado.\n Suelo de gres, armarios empotrados, calefaccin.\n Todos los servicios; autobuses, centros comerciales, centros mdicos, colegios, metro, supermercados.\n \n No te vendemos una casa, te proporcionamos tu hogar.\n Seguro que podemos ofrecerle una que se adapte a sus necesidades.\n POSIBILIDAD DE FINANCIACIN HASTA EL 100% NO DUDE EN CONTACTARNOS.', '164.999 ', '-3.6310182', '40.5439575', '[\"2nmero de pisos\",\"segunda mano\",\"armarios empotrados\",\"calefaccin\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/49909\\/49909-43911030-1098067866.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/49909\\/49909-43911030-1098067867.jpg.webp\"]'),
(5, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 2 habitaciones con terraza', '3', '79m', '2', '2', 'https://www.yaencontre.com/venta/piso/inmueble-39347-23-11-V', '91 489 09 13', 'PROMOVIVIENDA ofrece piso para entrar a vivir! \n\nVivienda compuesta por 2 amplios dormitorios y dos grandes cuartos de bao ambos con plato de ducha, cocina amplia amueblada y equipada, saln independiente. \n\nLa vivienda es una ultima planta y tiene acceso a la cubierta habilitada como a terraza compartida con solo 3 vecinos en el bloque. \n\nLa vivienda cuenta con ventanas de PVC climalit, suelos de tarima, electricidad y fontanera actualizada y lista para entrar a vivir. \n\nNO DEJE PASAR LA OPRTUNIDAD DE VIVITAR ESTE INMUEBLE. \n\nLLAMANOS SIN COMPROMISO. \nPROMOVIVIENDA \n910006247 MOVIL 683672140.', '167.000 ', '-3.6399069', '40.5437321', '[\"40gastos comunidad\",\"segunda mano\",\"1984ao de construccin\",\"3nmero de pisos\",\"armarios empotrados\",\"terraza\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39347\\/39347-44096593-1060967801.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39347\\/39347-44096593-1060967785.jpg.webp\"]'),
(6, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 3 habitaciones con terraza y aire acondicionado', '3', '96m', '2', '3', 'https://www.yaencontre.com/venta/piso/inmueble-40497-28-327-1180-V', 'Ver telfono', 'Preciosa vivienda de tres dormitorios con dos baos, con vistas despejadas y muchsima luz! en edificio con ascensor.\n\nLa vivienda cuenta con 96 m construidos (comprobados y que figuran en escrituras) y se distribuye en:\n\n- Hall de entrada.\n\n- Cocina muy cuadrada con muebles altos y bajos y espacio para una mesa.\n\n- Pasillo con un armario empotrado perfecto para guardar la ropa blanca.\n\n- Bao completo con ducha con mampara.\n\n- Dormitorio individual con aire acondicionado.\n\n- Dormitorio doble con armario de 4 cuerpos.\n\n- Saln independiente de 16 m con vistas despejadas.\n\n- Dormitorio principal de 13 m con armario empotrado de 2 cuerpos, con aire acondicionado y salida a una pequea terraza.\n\n- Bao principal en suite, completo con baera.\n\nLa vivienda tiene una excelente distribucin, con orientaciones Este y Oeste lo que le otorga muchsima luminosidad y ventilacin cruzada. Est situada en la ltima planta con muy buenas vistas, pero no es ni fra ni calurosa en verano ya que encima, en la bajocubierta, es donde se ubican los trasteros (dispone de 1 trastero incluido en el precio).\n\nDispone de suelos de parquet, aire acondicionado en dos dormitorios y en el saln, ventanas exteriores de climalit oscilobatientes, portero automtico y ascensor.\n\nEn cuanto al entorno est la Plaza del Pueblo a un minuto andando con todo tipo de servicios, para de autobuses del frica muy cerca, Metro Marqus de la Valdavia a 5 minutos andando y Renfe a 10.\n\nUna vivienda con encanto para vivir en el centro, con todo tipo de servicios a un paso, pero en un edificio super tranquilo y en una casa donde la luz entra por todos lados.\n\nLlmenos y le informaremos sin compromiso.\n\nLe ayudamos tambin en la bsqueda de su hipoteca, por menos precio de lo que paga de alquiler!', '265.000 ', '-3.6351196', '40.5400706', '[\"trastero\",\"segunda mano\",\"3nmero de pisos\",\"armarios empotrados\",\"ascensor\",\"aire acondicionado\",\"terraza\",\"calefaccin\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40497\\/40497-45215371-1089791285.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40497\\/40497-45215371-1089791286.jpg.webp\"]'),
