(29, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Estudio en venta en avenida De Fuencarral con garaje y jardn', '3', '70m', '1', 'No habitaciones', 'https://www.yaencontre.com/venta/piso/inmueble-39361-17194-V', '91 122 49 73', 'Precioso loft en una sola planta en el complejo Tribeca de Alcobendas, Avda. Fuencarral, n44, grandes ventanales, moderno, muy luminoso, habitacin independiente, bao completo con ducha, dispone de portero y seguridad 24horas. Difano. Cocina equipada con electrodomsticos. Semiamueblado, cama, una mesa, luces auxiliares, un sof y una butaca. Plaza de garaje incluida en el precio. \nLa urbanizacin se encuentra dentro del tringulo formado por La Moraleja, Alcobendas y San Sebastin de los Reyes, inmejorable situacin geogrfica, con acceso a todo tipo de servicios y comercios, cerca de la Universidad Autnoma de Madrid.\nEn la zona encontra1r con facilidad todo tipo de servicios en los tres Parque Comerciales que lo rodean: Rio Norte (Decathlon, AKI... ) DIVERSIA (primeras marcas de restauracin) y MORALEJA GREEN (primeras marcas de moda). Acceso directo a las autopistas A1, R2 y M-50 y a la nueva autopista M12 eje aeropuerto Madrid-Barajas.\nAeropuerto tan solo a 10 Km.\nTransporte publico: parada de metro cercana, distintas lneas de autobuses desde Plaza de Castilla.', '195.000 ', '-3.65578', '40.52496', '[\"jardn\",\"segunda mano\",\"calefaccin\",\"garaje\",\"armarios empotrados\",\"ascensor\",\"aire acondicionado\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39361\\/39361-40130857-1092730488.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39361\\/39361-40130857-1089594986.jpg.webp\"]'),
