(31, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 3 habitaciones con calefaccin', '3', '60m', '1', '3', 'https://www.yaencontre.com/venta/piso/inmueble-39373-MN-3011-V', '91 489 20 32', 'Magnfico piso interior de 3 dormitorios y 1 bao en Alcobendas.\n\nVivienda en buen estado con orientacin Sureste.\n\nDispone de 60 m2 construidos y 50 m2 tiles.\n\nCocina de 10 m2.\n\nCalefaccin individual por gas natural.\n\nArmarios empotrados, ventanas de aluminio, puertas de madera y suelo de baldosa.\n\nNO PIERDA ESTA OPORTUNIDAD Y CONTACTE CON NOSOTROS PARA REALIZAR UNA VISITA.\n\nDaurum Estate ofrece conseguir la mejor financiacin a su medida hasta el 100% del valor de compra - venta sea nuestra la vivienda o no.\n\nINFORMACIN SIN COMPROMISO en el mismo nmero de telfono del anuncio.\n\nAdems, posibilidad de servicio de reformas para acomodar la vivienda a su gusto.', '165.000 ', '-3.6279182', '40.5415575', '[\"segunda mano\",\"2nmero de pisos\",\"calefaccin\",\"armarios empotrados\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39373\\/39373-40132427-956866703.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39373\\/39373-40132427-956866706.jpg.webp\"]'),
(32, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en Ensanche de 2 habitaciones con aire acondicionado y calefaccin', '3', '70m', '2', '2', 'https://www.yaencontre.com/venta/piso/inmueble-49909-M163-V', '87 627 66 34', 'POSIBILIDAD DE FINANCIACIN HASTA EL 100 %\n NO DUDE EN CONTACTARNOS!\n \n ESTUPENDO PISO REFORMADO EN EL CENTRO DE ALCOBENDAS!\n ***PUEDE SER SUYO DESDE 528 euros/ MES***\n \n Piso BAJO de 70 m2 completamente reformado.\n Se encuentra cerca de metro, parques, biblioteca, comercios, centros de salud y colegios.\n Tiene dos habitaciones, dos baos y cocina completamente amueblada con electrodomsticos nuevos.\n La vivienda cuenta con amplio dormitorio independiente con doble armario empotrado, totalmente vestido en su interior, y bao de cuatro piezas, mampara y acabados modernos e incluso pequea ducha en inodoro.\n La segunda habitacin tiene su armario empotrado totalmente vestido en su interior y bao de tres piezas, mampara y acabados modernos. Tambin cuanta con ducha en inodoro.\n Saln-comedor luminoso con chimenea elctrica.\n Suelo de tarima en todo el piso.\n Instalaciones de fontanera, electricidad, ventanas de pvc con persianas y doble acristalamiento, puertas de paso y puerta blindada.\n Calefaccin y aire acondicionado mediante conductos y rejillas de impulsin, todo a estrenar.\n Agua caliente por termo elctrico de 80 l.\n Aislamiento trmico y acstico en paredes colindantes.\n \n No te vendemos una casa, te proporcionamos tu hogar.\n Seguro que podemos ofrecerle una que se adapte a sus necesidades.\n POSIBILIDAD DE FINANCIACIN HASTA EL 100% NO DUDE EN CONTACTARNOS.', '189.999 ', '-3.644029', '40.5449542', '[\"segunda mano\",\"armarios empotrados\",\"aire acondicionado\",\"calefaccin\",\"chimenea\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/49909\\/49909-43492579-1098067774.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/49909\\/49909-43492579-1098067775.jpg.webp\"]'),
(33, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Norte de 3 habitaciones con terraza y piscina', '3', '137m', '2', '3', 'https://www.yaencontre.com/venta/piso/inmueble-45201-924-MC468-VEN_-V', '91 218 39 61', 'Piso 137 m en Alcobendas, Madrid SIN COMISIN! Cornejo Inmuebles ofrece en venta piso de 137m2 construidos, totalmente amueblado, con mobiliario de calidad, en Alcobendas (Madrid), zona Marqus de la Valdavia, frente a la estacin de Cercanas - Valdelasfuentes. \n\nEdificio construido en 2004, vivienda en perfecto estado, para entrar a vivir y con orientacin Este.\n \nEl piso se distribuye en hall, saln 32m2, con dos ambientes y salida a terraza de 7m2 acristalada con sistema verano-invierno de carril cortina corredera y calefaccin y toldo, tres dormitorios, dos de ellos dobles de 10m2 y un tercero en suite de 15m2, dos baos completos, con amplios platos de ducha. Dispone de cocina en L con mesa y terraza tendedero con zona de lavado.\nCuenta con plaza DOBLE de garaje grande para dos coches en el propio edificio y amplio trastero de 18m3 con baldas. Las zonas comunes se componen de piscina, zona de juegos y portero fsico. Las comunicaciones son ideales: Cercanas y autobuses frente a la vivienda a 50metros, Metro de Manuel de Falla a 500metros. \nLa zona tiene todos los servicios: restaurantes, clnica mdica, colegios, comercios y supermercados.\nPara entrar a vivir, con aire acondicionado mediante 4 splits individuales en las 3 habitaciones y saln.\nInformacin complementaria: Video portero, luces LED, 7 armarios empotrados y acceso personas con movilidad reducida. Caldera Saunier Duval con mando a distancia, radiadores en toda la casa, horno digital con pirolisis e incluye coccin por vapor, frigorfico grande y congelador independiente de 6 cajones, lavadora, secadora, lavavajillas, placa induccin digital de cuatro fuegos y campana extractora, suelo de madera de tarima impermeable y antirrayaduras recin puesto, puerta blindada con cerradura de alta seguridad anti-bumping anti-rotura anti-taladro con llave no reproducible, alarma instalada y caja fuerte. \n TOTALMENTE AMUEBLADO.', '520.000 ', '-3.6533314', '40.547931', '[\"trastero\",\"jardn\",\"segunda mano\",\"111gastos comunidad\",\"1nmero de pisos\",\"balcn\",\"calefaccin\",\"garaje\",\"ascensor\",\"piscina\",\"armarios empotrados\",\"aire acondicionado\",\"terraza\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/45201\\/45201-45118604-1086983400.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/45201\\/45201-45118604-1086983399.jpg.webp\"]'),
(34, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en Arroyo de la Vega de 4 habitaciones con garaje y aire acondicionado', '3', '129m', '2', '4', 'https://www.yaencontre.com/venta/piso/inmueble-40473-95047347-V', 'Ver telfono', 'Agencia Negociadora del Alquiler vende estupenda vivienda con reforma integral, de 129 m2 ( 113 m2 tiles ) segn catastro, exterior y muy luminosa en finca con ascensor. \n\nConsta de 4 dormitorios, 2 cuartos de bao (uno en suite con cabina de hidromasaje), amplio saln comedor, cocina independiente y tendedero.\n\nPuerta blindada, suelos de plaqueta y parquet, calefaccin central, aire acondicionado con bomba de calor, armarios empotrados, ventanas de PVC tipo climalit y se vende semi amueblada (algunos muebles se retirarn antes de firmar escrituras). Plaza de garaje incluida en el precio. Los honorarios de la agencia no estn incluidos en el precio (3%+IVA) y corresponden al comprador.', '375.000 ', '-3.6364566', '40.5368812', '[\"segunda mano\",\"4nmero de pisos\",\"calefaccin\",\"garaje\",\"armarios empotrados\",\"ascensor\",\"aire acondicionado\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40473\\/40473-42903376-1030037785.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40473\\/40473-42903376-1030037786.jpg.webp\"]');
