(35, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en calle Albacete de 2 habitaciones con terraza y garaje', '3', '69m', '2', '2', 'https://www.yaencontre.com/venta/piso/inmueble-61011-96759425-V', '91 489 61 78', 'Imaginas disfrutar de una vivienda con un TERRAZA de 33 m2 a 100 metros de la rotonda de la Menina con la cmoda proximidad a los comercios, servicios y medios de transporte y a solo un salto de la salida de la ciudad? . En la promocin residencial de Albacete 8 lo encontrars! \nLa promocin residencial de la Calle Albacete 8 constar de 7 viviendas, la premisa bsica del diseo es la luminosidad y el confort. En esta publicacin te presentamos uno de los pisos de entreplanta con dos dormitorios, un bao y un aseo a destacar por su amplia terraza de 33 m2.\nLa vivienda se entrega con armarios empotrados, muebles bajos y mampara en el bao, muebles de cocina altos y bajos con fregadero empotrado, vitrocermica y campana extractora. Es posible realizar algunos ajustes al proyecto y as ajustar la vivienda segn tus necesidades.\nEl piso constar con una caldera individual de gas natural para agua caliente y calefaccin, apoyado por un sistema de produccin de agua caliente sanitara (ACS) y de calefaccin, mediante captadores solares de alto rendimiento.\nCon posibilidad de adquirir una plaza de garaje no includa en el precio.\nLa fecha de entrega estimada de las viviendas es mayo de 2023.\nEl acceso al transporte pblico es muy amplio, a 3 minutos andando est la parada de autobuses, a 5 minutos andando est la lnea 10 del sistema Metro, 14 minutos andando al Cercanas (C4) y fcil acceso a A1, M40 o la M607.\nEl precio indicado no incluye IVA.\n\nNO DEMORES! , LLMANOS Y TE DAREMOS MS INFORMACIN.\n\n(Los datos indicados son de carcter informativos, sin valor contractual. El impuesto no est incluido).', '250.000 ', '-3.6346776', '40.5385622', '[\"2023ao de construccin\",\"segunda mano\",\"garaje\",\"terraza\",\"ascensor\",\"armarios empotrados\",\"aire acondicionado\",\"calefaccin\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/61011\\/61011-45164580-1088446257.jpg.webp\"]'),
(36, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en Ensanche de 1 habitacin con terraza y aire acondicionado', '3', '83m', '1', '1', 'https://www.yaencontre.com/venta/piso/inmueble-39373-MN-3641-V', '91 489 20 32', 'Maravilloso Piso exterior de 1 habitacin y 1 bao, con sauna y jacuzzi en Alcobendas.\n\nVivienda en buen estado, reformada integralmente en 2018. Orientacin Suroeste.\n\nDispone de 83 m2 construidos y 74 m2 tiles.\n\nTerraza 6 m2.\n\nCocina integrada a saln.\n\nCalefaccin individual elctrica y aire acondicionado por split.\n\nArmarios empotrados, ventanas pvc climalit y suelo de tarima.\n\nTiene trastero.\n\nNO PIERDA ESTA OPORTUNIDAD Y CONTACTE CON NOSOTROS PARA REALIZAR UNA VISITA.\n\nDaurum Estate ofrece conseguir la mejor financiacin a su medida hasta el 100% del valor de compra - venta sea nuestra la vivienda o no.\n\nINFORMACIN SIN COMPROMISO en el mismo nmero de telfono del anuncio.\n\nAdems, posibilidad de servicio de reformas para acomodar la vivienda a su gusto.', '315.000 ', '-3.64192', '40.5409999', '[\"trastero\",\"1970ao de construccin\",\"segunda mano\",\"1nmero de pisos\",\"calefaccin\",\"armarios empotrados\",\"aire acondicionado\",\"terraza\"]', '[]'),
(37, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 3 habitaciones con terraza y muebles', '3', '76m', '1', '3', 'https://www.yaencontre.com/venta/piso/inmueble-51770-1435-V', '91 179 48 39', '! Oportunidad! , Se vende piso exterior, actualizado hace 3 aos, totalmente amueblado y muy luminoso.\nEl inmueble consta de:\n- El inmueble consta de:\n- Tres dormitorios amueblados.\n- Cocina equipada y amueblada con electrodomsticos.\n- Bao completo con baera.\n- Saln-comedor con salida a terraza exterior.\nAdems dispone de: Portero automtico, puerta blindada.! Mejor ver! .\nEl inmueble se encuentra ubicado en una zona muy consolidada con todo tipo de dotaciones urbanas en sus inmediaciones... (Colegios, supermercados, parques, transporte pblico).\nADEMS LE OFRECEMOS LA FINANCIACIN EN INMEJORABLES CONDICIONES.', '179.000 ', '-3.6381', '40.5399787', '[\"4nmero de pisos\",\"45gastos comunidad\",\"segunda mano\",\"terraza\",\"amueblado\",\"calefaccin\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/51770\\/51770-45129143-1111436917.jpg.webp\"]'),
(38, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de estudio en El Soto de la Moraleja con garaje y calefaccin', '3', '66m', '1', 'No habitaciones', 'https://www.yaencontre.com/venta/piso/inmueble-54786-BV-4577-0-V', '91 635 81 57', ' COMPRAR LOFT EN EL COMPLEJO TRIBECA, ALCOBENDAS!\n \n Incorporamos loft muy cerca del CC de la Moraleja Green, con buena comunicacin con la A1 en la Carretera de Fuencarral. En una urbanizacin privada que dispone de sistema de seguridad 24h.\n \n Si eres autnomo o empresa y buscas una oficina en este complejo tan conocido, este es tu loft. Por el contrario buscas para vivir, este es tu loft tambin. Est listo para que hagas mudanza y lo decores a tu gusto, para que te quede una oficina de lo ms confortable, con los grandes ventanales que tiene no te faltar la luz natural y la luminosidad. Bomba de fro-calor. Plaza de garaje incluida en el precio.\n \n Disponibilidad inmediata. Llmanos!', '186.990 ', '-3.6465803', '40.5304772', '[\"2008ao de construccin\",\"1nmero de pisos\",\"85gastos comunidad\",\"segunda mano\",\"ascensor\",\"calefaccin\",\"garaje\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/54786\\/54786-44882668-1109948157.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/54786\\/54786-44882668-1109948158.jpg.webp\"]'),
(39, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso nuevo en calle Alicante y de 2 habitaciones y 68 m', '3', '68m', '1', '2', 'https://www.yaencontre.com/venta/piso/inmueble-59084-Promo-1-95390574', '91 217 03 91', 'Edificio de nueva construccin sito en Alcobendas Centro, prximo a la estacin de Alcobendas- SS de los Reyes de Cercanas Renfe y a la estacin Marques de la Valdavia de la lnea 10 del Metro. \nLa calle Alicante se encuentra situada paralela al bulevar de Salvador Allende, y prxima al parque del Arroyo de la Vega. El edificio se compone de 10 viviendas de uno, dos y tres dormitorios, con viviendas en planta baja y tico con terrazas. Presenta fachadas hacia la calle y hacia la parte de atrs de la parcela (en los planos se menciona como interior). La construccin se completa con diecisis plazas de garaje y cinco trasteros. \n\nEl edificio cuenta con la mxima calificacin energtica de Proyecto, letra A, con soluciones de climatizacin y ventilacin de alta eficiencia energtica, que unidas al aislamiento trmico del edificio consiguen consumos energticos y emisiones de CO2 reducidas. Se trata de viviendas saludables, dotadas de Aerotermia, suelo radiante y refrescante y sistema de ventilacin individual por vivienda dotados de recuperadores de calor de alta eficiencia.\n\nLa plaza de garaje es opcional, a un precio de 16.750  ms IVA. Tambin existe la posibilidad de adquirir una segunda plaza de garaje dentro del mismo edificio al mismo precio de 16.750  ms IVA.\n\nIgualmente el trastero es opcional, con un precio de 9.750  ms IVA \n\nMontacoches para vehculos.\n\nLicencia concedida. Prximo inicio de obras. Fase solicitud reservas.\n\nLos precios no incluyen IVA.', '218.750 ', '-3.6331205', '40.5389183', '[\"nuevo\",\"obra nueva\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/promo_59084-1\\/files\\/59084-44853123-1081631866.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/promo_59084-1\\/files\\/59084-44853123-