(40, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en calle Marques de la Valdavia de 4 habitaciones con terraza y garaje', '3', '143m', '2', '4', 'https://www.yaencontre.com/venta/piso/inmueble-27997-5089-00579', '91 179 88 39', 'Piso de 4 habitaciones, dos cuartos de bao completos, saln independiente con terraza, cocina con tendero. Muy luminoso. Tiene suelos de parque, puerta  blindada, aire acondicionado. .  .  Dispone de armarios empotrados en las habitaciones y tambin en el pasillo que distribuye las estancias de la vivienda..  Posibilidad de plaza de garaje..  .  Muy bien comunicado, con zonas verdes, colegios y centro mdico..', '340.000 ', '-3.636362304', '40.540487082', '[\"32m saln\",\"32m comedor\",\"32m saln comedor\",\"4n hab. dobles\",\"69gastos comunidad\",\"segunda mano\",\"ascensor\",\"calefaccin\",\"garaje\",\"puerta de seguridad\",\"terraza\",\"aire acondicionado\",\"armarios empotrados\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/27997\\/27997-43551246-1056896080.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/27997\\/27997-43551246-1056896081.jpg.webp\"]'),
(41, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Norte de 2 habitaciones con terraza y piscina', '3', '94m', '2', '2', 'https://www.yaencontre.com/venta/piso/inmueble-38562-1592-V', '91 217 65 89', 'VISITE HOY! Rogel Propiedades vende piso en urbanizacin privada con zonas verdes, conserje, piscina, trastero y plaza de garaje. Zona bien comunicada por metro, bus y cercanas con todos los servicios, colegios, ambulatorio, farmacia, supermercados, etc.\n\nDe 94 m2 distribuidos en amplio saln comedor con salida a terraza, cocina amueblada y equipada con electrodomsticos, 2 dormitorios y 2 baos.\n\n2 PLAZAS DE GARAJE Y TRASTERO!\n\nFINANCIACIN\n\nDisponemos de un departamento financiero que conseguiremos la hipoteca que mejor se adapta a ti:\n\nTrabajamos con las principales entidades financieras para facilitar el crdito que necesita el comprador, asesorndole en los pasos a seguir para la obtencin del mismo SIN COSTES DE INTERMEDIACIN.\n\nA continuacin detallamos alguno de nuestros servicios:\n\nCAMBIO DE CASA: Disponemos de productos financieros especiales para los casos en los que nuestros clientes necesitan vender para comprar y ayudamos a establecer un plan de actuacin efectivo y realista para que el proceso sea rpido y eficaz.\n\nFINANCIACIN 100%: Podemos conseguir financiacin en aquellos casos donde otros no llegan, gracias a que no cobramos a nuestros clientes por el servicio.\n\nRESPONSABILIDAD: Ante todo practicamos y aconsejamos la Hipoteca Responsable, asesorando a \nnuestros clientes para que piensen en el presente pero tambin en el futuro, evitando sorpresas desagradables. Compromiso, transparencia, flexibilidad y experiencia son nuestros pilares.\n\nCONTRAOFERTA: Si usted ya dispone de una oferta de financiacin, consulte nuestras posibilidades de mejora. Se sorprender!\n\nCITA PREVIA: Solicite cita previa con nuestro servicio de asesoramiento financiero y podr conocer cuales son sus posibilidades reales de compra, as como los productos de que actualmente hay disponibles para financiar su compra.\n\nPara mas informacin contactar con el anunciante.', '385.000 ', '-3.6606994', '40.5511969', '[\"trastero\",\"jardn\",\"segunda mano\",\"ascensor\",\"garaje\",\"calefaccin\",\"terraza\",\"aire acondicionado\",\"armarios empotrados\",\"piscina\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/38562\\/38562-44786720-1078515932.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/38562\\/38562-44786720-1078515933.jpg.webp\"]'),
