(45, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Norte de 3 habitaciones con terraza y piscina', '3', '137m', '2', '3', 'https://www.yaencontre.com/venta/piso/inmueble-45201-924-MC468-V', '91 218 39 61', 'Piso 137 m en Alcobendas, Madrid Cornejo Inmuebles ofrece en venta piso de 137m2 construidos, totalmente amueblado, con mobiliario de calidad, en Alcobendas (Madrid), zona Marqus de la Valdavia, frente a la estacin de Cercanas - Valdelasfuentes. \n\nEdificio construido en 2004, vivienda en perfecto estado, para entrar a vivir y con orientacin Este.\n \nEl piso se distribuye en hall, saln 32m2, con dos ambientes y salida a terraza de 7m2 acristalada con sistema verano-invierno de carril cortina corredera y calefaccin y toldo, tres dormitorios, dos de ellos dobles de 10m2 y un tercero en suite de 15m2, dos baos completos, con amplios platos de ducha. Dispone de cocina en L con mesa y terraza tendedero con zona de lavado.\nCuenta con plaza DOBLE de garaje grande para dos coches en el propio edificio y amplio trastero de 18m3 con baldas. Las zonas comunes se componen de piscina, zona de juegos y portero fsico. Las comunicaciones son ideales: Cercanas y autobuses frente a la vivienda a 50metros, Metro de Manuel de Falla a 500metros. \nLa zona tiene todos los servicios: restaurantes, clnica mdica, colegios, comercios y supermercados.\nPara entrar a vivir, con aire acondicionado mediante 4 splits individuales en las 3 habitaciones y saln.\nInformacin complementaria: Video portero, luces LED, 7 armarios empotrados y acceso a personas con movilidad reducida. Caldera Saunier Duval con mando a distancia, radiadores en toda la casa, horno digital con pirolisis e incluye coccin por vapor, frigorfico grande y congelador independiente de 6 cajones, lavadora, secadora, lavavajillas, placa induccin digital de cuatro fuegos y campana extractora, suelo de madera de tarima impermeable y antirrayaduras recin puesto, puerta blindada con cerradura de alta seguridad