(47, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en Ensanche de 2 habitaciones y 45 m', '3', '45m', '1', '2', 'https://www.yaencontre.com/venta/piso/inmueble-61011-0055-00022-V', '91 489 61 78', 'La Avenida de la Zaporra, muy cercana al Ayuntamiento de Alcobendas, cuenta con aceras y calzadas anchas, con rampas de acceso a las viviendas. \n\nEl piso es un bajo de 44 m2, que est para reformar. \nActualmente est divido en:\n2 Dormitorios\n1 Bao\nSaln \nCocina\n\nLas siguientes lneas de transporte tienen rutas que pasan cerca de Avenida de la Zaporra Autobs: 10, 151; \nTren: C4 Alcobendas - San Sebastin de los Reyes; \nMetro: M-10 Manuel de Falla.\n\nCentro Comercial, Supermercado, Escuelas, son algunas de las cosas con las que cuenta cercano la vivienda. \n\nExcelente oportunidad, llama para conocerla!\n\nTE ESPERAMOS!\n\nLos datos indicados son de carcter informativos, sin valor contractual. Los impuestos no estn incluidos.', '87.000 ', '-3.6394107', '40.5491241', '[\"1967ao de construccin\",\"segunda mano\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/61011\\/61011-45177795-1088699695.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/61011\\/61011-45177795-1088699696.jpg.webp\"]'),
