(49, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Piso en venta en Centro - Alcobendas de 2 habitaciones con aire acondicionado', '3', '55m', '1', '2', 'https://www.yaencontre.com/venta/piso/inmueble-39079-Ebroloft00-V', '91 800 69 28', 'Gestinmo Servicios Inmobiliarios ofrece IDEAL PARA INVERSORES, espectacular local para transformar en Vivienda que se encuentra en la Calle Ebro, Alcobendas. \n\nEs un local que tiene 55m2 y esta difano con posibilidad de distribuirlo en saln, cocina, bao y uno dormitorio, adems de un amplio trastero. \n\nSe trata de un inmueble cntrico que dispone de aire acondicionado, entrada desde calle, falso techo y un amplio escaparate de 4 metros lineales, adems de tener un almacenen altillo para usarse como maletero.\n\nEl local cuenta con salida de humos, anteriormente era un bar y tambin se puede conservar la actividad en caso de interesar. \n\nPresupuesto aproximado de reforma es de 15.000.\nEl local solo tiene un valor de 67.000.\n\nSe sita prximo a superficies comerciales, a 400 metros del ayuntamiento y junto a entidades bancarias, colegios, a escasos metros de la Avenida Espaa y la gran manzana. \n\nAlrededor de la zona cuenta de mltiples servicios pblicos y comercios como supermercados, o centros comerciales. \n\nTambin consta de buena comunicacin y transporte pblico.\n\nAgencia Inmobiliaria con oficina en Madrid y San Sebastin de los Reyes.\nMucho ms que gestin inmobiliaria!\nEncuentra ms ofertas en\n\nPara ms informacin no dude en contactar con nosotros, estaremos encantados de atenderte.', '82.000 ', '-3.6376946', '40.5465909', '[\"trastero\",\"1975ao de construccin\",\"8gastos comunidad\",\"segunda mano\",\"aire acondicionado\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39079\\/39079-45115667-1086871631.jpg.webp\",\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/39079\\/39079-45115667-1086871632.jpg.webp\"]'),
(50, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en El Soto de la Moraleja de 4 habitaciones con terraza y piscina', '3', '341m', '4', '4', 'https://www.yaencontre.com/venta/piso/inmueble-40015-OP-31200-V', '91 179 39 54', '* Sin comisin * En EXCLUSIVA Zona - Visitas 911236002 * EVERYPROP INTERNATIONAL LUXURY REALTY Moraleja y Madrid 91 123 60 02 everyprop.com presenta Piso de Lujo en Soto de la Moraleja Madrid.\n\nPiso Lujo de ms de 340 m2\n3 Habitaciones + Servicio / 3 baos + Servicio\nHall de entrada, amplio saln en tres ambientes con chimenea y salida a la terraza, comedor, cocina con office y tendedero; despacho, tres dormitorios en suite con vestidor; y zona de servicio con habitacin, bao y zona de lavandera\nCalefaccin central y Aire Acondicionado\nSistema de Domtica\nrea de Servicios\nMuy Luminoso\nTerraza\nZona Infantil y Piscina Comunitaria\nPista de Tenis\nGimnasio y Sauna\nPlaza de Garaje y aparcamiento libre para otro coche\n2 Trasteros\nPiso en la mejor zona de Soto de la Moraleja; cerca de Colegios, Transportes y Servicios\nUrbanizacin cerrada con seguridad 24 horas\nMuy buen estado\n\nReferencia: EP-31200\n\nPrecio negociable, llmenos para coordinar una visita. Ofrecemos un servicio exclusivo y personalizado, y podemos ayudarle a encontrar la propiedad que busca.\n\nHablamos Espaol. We speak English. Wir sprechen Deutsch. Nous parlons Franais.\n\nNuestras oficinas de Madrid se encuentran en la Calle Serrano del Barrio de Salamanca, en la Plaza de la Moraleja y en Las Rozas.\n\nLos barrios de Madrid Capital: \n- Centro (Huertas / Cortes, Lavapis / Embajadores, Chueca / Justicia, Palacio, Sol y Malasaa / Universidad)\n- Chamartn (Castilla, Ciudad Jardn, El Viso, Bernabu / Hispanoamrica y Nueva Espaa)\n- Chamber (Almagro, Arapiles, Gaztambide, Nuevos Ministerios / Ros Rosas, Trafalgar y Vallehermoso)\n- Ciudad Lineal (Colina, Costillares y San Juan Bautista)\n- Fuencarral (Fuentelarreina, Mirasierra y Peagrande)\n- Hortaleza (Canillas, Conde Orgaz / Piovera y Palomas)\n- Moncloa (Aravaca, Argelles, Ciudad Universitaria, El Planto y Valdemarn)\n- Retiro (Ibiza, Jernimos y Nio Jess)\n- Salamanca (Castellana, Fuente del Berro, Goya, Guindalera, Lista y Recoletos)\n- Tetan (Cuzco / Castillejos y Cuatro Caminos)\n\nLos barrios de la Zona Norte de Madrid\n- rea de la Moraleja (La Moraleja, Arroyo de la Vega, El Soto de la Moraleja, y Encinar de los Reyes)\n- rea de Santo Domingo / Ciudalcampo (Ciudalcampo, Santo Domingo y Valdelagua)\n- Tres Cantos (Soto de Viuelas)\n- Fuente del Fresno / Club de Campo (Fuente del Fresno)\n\nLos barrios de la Zona Noroeste de Madrid\n- Boadilla del Monte (Bonanza, Las Lomas, Urb. este / Monteprncipe, Valdecabaa y Valdepastores / Las Encinas)\n- Las Rozas (Club de Golf, El Pinar / Punta Galea, Molino de la Hoz y Monte Rozas)\n- Majadahonda (Zona Carretera del Planto y Zona Monte el Pilar)\n- Pozuelo de Alarcn (Somosaguas, Urbanizaciones - La Cabaa, Montealina, Monteclaro, Prado Largo, Zona Avenida Europa, Zona Estacin, La Finca, Prado de Somosaguas y Zona Pueblo)\n- Villaviciosa de Odn (Castillo / Campodn y El Bosque)\n\nVisite nuestra web para conocer toda nuestra oferta. A su vez disponemos de cientos de propiedades en Cartera Privada (activas en venta y/o alquiler cuyos propietarios no quieren anunciar en medios digitales). Consulte otras opciones.', '1.340.000 ', '-3.6415413', '40.5190851', '[\"trastero\",\"jardn\",\"1977ao de construccin\",\"segunda mano\",\"1nmero de pisos\",\"piscina\",\"armarios empotrados\",\"garaje\",\"calefaccin\",\"balcn\",\"ascensor\",\"chimenea\",\"terraza\",\"aire acondicionado\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40015\\/40015-43663781-1047417725.jpg.webp\"]'),
(51, '2022-06-01 08:36:55', '2022-06-01 08:36:55', 1, 'Venta de piso en El Soto de la Moraleja de 5 habitaciones con terraza y piscina', '3', '350m', '4', '5', 'https://www.yaencontre.com/venta/piso/inmueble-40170-96874540-V', '91 489 92 23', 'ZAFIR REAL ESTATE Les ofrece este impresionante piso de 341 m2 reformado en el corazn del Soto de La Moraleja. ORIENTACIN SURESTE. La vivienda se encuentra en una de las mejores urbanizaciones del Soto de La Moraleja con seguridad 24 horas, dos piscinas (adulto/ infantil), pista de tenis, campo de ftbol, zona infantil, gimnasio, sala de reuniones, extensas zonas verdes y servicio de conserjera y seguridad 24 horas. Destaca la amplitud, luminosidad y terrazas.\nLa localizacin es insuperable, a pocos minutos del Club de Tenis La Moraleja, el colegio San Patricio, centro comercial el Porche dotado de todo tipo de servicios incluido supermercado y zona de restauracin y La Plaza de La Moraleja donde podemos encontrar dos supermercados, farmacia, estanco y dems servicios y por supuesto una amplia variedad de restaurantes, bares y cafeteras.\nLa distribucin es como sigue: \nAmplio hall de entrada, armarios recibidores, gran saln con chimenea y salida a una de las terrazas con vistas a las zonas verdes de la urbanizacin. Conectado con el saln a travs de puerta corredera, comedor independiente con salida a otra terraza. Aseo de cortesa. Cocina de grandes dimensiones con office equipada con electrodomsticos de alta gama, zona de lavandera y tendedero. Dormitorio de servicio y bao. Esta zona cuenta con entrada independiente (Puerta de seguridad). Zona de descanso: Dormitorio de gran tamao con bao en suite y salida a una de las terrazas. En el otro ala del piso, encontramos el dormitorio principal con vestidor y bao en suite (baera de hidromasaje, doble lavabo y ducha). Otros dos dormitorios dobles que comparte un bao completo.\nCuenta tambin con una buhardilla de 60m2 con bao que est situada en la ltima planta del edificio. Dos plazas de garaje ms 2 exteriores. Trastero. Agua caliente y calefaccin central de gas natural. Aire acondicionado.\nEl Soto de La Moraleja, perteneciente a La Moraleja, es una de las zonas residenciales ms exclusivas de Madrid.\nSe encuentra a 12 km del centro de la capital. Hay diversas lneas de autobs garantizan un rpido acceso al centro. Tambin hay que destacar la proximidad al aeropuerto Adolfo Surez. Se accede con mucha comodidad a los principales viales de Madrid como la A-1 (Madrid-Burgos), M-40.\nEl Soto est compuesto por urbanizaciones de pisos, ticos, pisos bajos con jardn y chalets de muy diferentes tipologas. Goza de grandes zonas verdes, parques infantiles, reas deportivas.\nAsimismo esta zona es una de las ms seguras y tranquilas de Madrid debido al servicio de vigilancia presente durante las 24 horas del da.\nLa zona ofrece la tranquilidad de contar en sus inmediaciones con prestigiosos colegios y guarderas privadas (San Patricio, El Jardn de las Irlandesas... )\nCentros Comerciales como Moraleja Green y Los Cedros ofrecen una cuidada seleccin de restaurantes, tiendas de moda, centros de belleza, peluqueras, farmacias, supermercados, bancos...).', '1.700.000 ', '-3.640597', '40.5192942', '[\"trastero\",\"jardn\",\"segunda mano\",\"2nmero de pisos\",\"calefaccin\",\"chimenea\",\"garaje\",\"ascensor\",\"piscina\",\"armarios empotrados\",\"aire acondicionado\",\"terraza\"]', '[\"https:\\/\\/media.yaencontre.com\\/img\\/photo\\/w1024\\/40170\\/40170-45128375-1087411640.jpg.webp\"]');

